import { useRef } from 'react';
import { Parallax, ParallaxLayer } from '@react-spring/parallax';
import styles from './mainMenu.module.css';  // Import your CSS module here

function MainMenu() {
  const ref = useRef();

  return (
    <div>
      <Parallax pages={4} ref={ref}>
        {/* Background Image Layer */}
        <ParallaxLayer
          offset={0}
          speed={1}
          factor={2}
          style={{
            backgroundImage: `url('background-image.jpg')`, // Replace with your background image
            backgroundSize: 'cover',
            backgroundPosition: 'center',
          }}
        />

        {/* "My Likes" Button */}
        <ParallaxLayer
          offset={0.5}
          speed={0.5}
          style={{
            textAlign: 'center',
            display: 'flex',
            justifyContent: 'center',
            alignItems: 'center',
            height: '100vh',
          }}
        >
          <button className={styles.parallaxButton} onClick={() => ref.current.scrollTo(1)}>
            My Likes
          </button>
        </ParallaxLayer>

        {/* "My Watchlist" Button */}
        <ParallaxLayer
          offset={1}
          speed={0.4}
          style={{
            textAlign: 'center',
            display: 'flex',
            justifyContent: 'center',
            alignItems: 'center',
            height: '100vh',
          }}
        >
          <button className={styles.parallaxButton} onClick={() => ref.current.scrollTo(2)}>
            My Watchlist
          </button>
        </ParallaxLayer>

        {/* "My Wishlist" Button */}
        <ParallaxLayer
          offset={1.5}
          speed={0.6}
          style={{
            textAlign: 'center',
            display: 'flex',
            justifyContent: 'center',
            alignItems: 'center',
            height: '100vh',
          }}
        >
          <button className={styles.parallaxButton} onClick={() => ref.current.scrollTo(3)}>
            My Wishlist
          </button>
        </ParallaxLayer>

        {/* "I'm Feeling Lucky" Button */}
        <ParallaxLayer
          offset={2}
          speed={0.3}
          style={{
            textAlign: 'center',
            display: 'flex',
            justifyContent: 'center',
            alignItems: 'center',
            height: '100vh',
          }}
        >
          <button className={styles.parallaxButton} onClick={() => ref.current.scrollTo(4)}>
            I'm Feeling Lucky
          </button>
        </ParallaxLayer>

        {/* "Search" Button */}
        <ParallaxLayer
          offset={2.5}
          speed={0.5}
          style={{
            textAlign: 'center',
            display: 'flex',
            justifyContent: 'center',
            alignItems: 'center',
            height: '100vh',
          }}
        >
          <button className={styles.parallaxButton} onClick={() => ref.current.scrollTo(5)}>
            Search
          </button>
        </ParallaxLayer>

        {/* "About Us" Button */}
        <ParallaxLayer
          offset={3}
          speed={0.7}
          style={{
            textAlign: 'center',
            display: 'flex',
            justifyContent: 'center',
            alignItems: 'center',
            height: '100vh',
          }}
        >
          <button className={styles.parallaxButton} onClick={() => ref.current.scrollTo(6)}>
            About Us
          </button>
        </ParallaxLayer>

        {/* Final Section */}
        <ParallaxLayer
          offset={3.5}
          speed={0.1}
          style={{
            textAlign: 'center',
            display: 'flex',
            justifyContent: 'center',
            alignItems: 'center',
            height: '100vh',
            backgroundColor: 'lightgray',
          }}
        >
          <h2>Thank you for visiting!</h2>
        </ParallaxLayer>
      </Parallax>
    </div>
  );
}

export default MainMenu;
